import { Component } from '@angular/core';
import { CustomerService } from '../customer.service';
import { Customer } from './customer';

@Component({
  selector: 'app-customer',
  templateUrl: './customer.component.html',
  styleUrls: ['./customer.component.css']
})
export class CustomerComponent {

  constructor(private service: CustomerService){

  }

  ngOnInit(): void {

    c.firstNameCustomer = 'Nicoly';
    c.lastNameCustomer = 'Carneiro';
    c.cpfCustomer = '45334645055';
    c.birthdateCustomer = '20-09-1983';
    c.emailCustomer = 'tiago@angular.com';
    c.monthlyIncomeCustomer = 1000;
    c.statusCustomer = true;
    c.passwordCustomer = '123456';

    this.service.save(c).subscribe(response => {
      console.log(response);
    })
  }

}
